sfmc.prototype.getToken = function(authEndpoint,clientId,clientSecret,refreshToken,accessType){
    // Return new promise
    return new Promise(function(resolve, reject) {
            var payload =   {
                "clientId": clientId,
                "clientSecret": clientSecret,
                "refreshToken": refreshToken,
                "accessType": accessType
            };

            var restoptions = {
                "url":        "https://auth.exacttargetapis.com/v1/requestToken",
                "method":     "POST",
                "headers":    {
                    "content-type":"application/json"
                },
                "body": JSON.stringify(payload)
            };

        	// Do async job
            request.post(restoptions, function(err, response, body) {
                if (err) {
                    console.log(JSON.stringify(err));
                    reject(err);
                } else {
                    //console.log("Access Token",body);
                    var resp = JSON.parse(body);
                    if (resp.accessToken){
                        resolve(resp);
                    } else {
                        reject(new Error('Failed to get access token from SFMC'));
                    }
                }
            })
    });
}

sfmc.prototype.retrieve = function(options) {
    var endpoint = options.Endpoint + 'Service.asmx';

    // Get Data Extension Fields
    var soap =     `<Envelope xmlns="http://schemas.xmlsoap.org/soap/envelope/" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">
                     <Header>
                          <fueloauth>${options.Token}</fueloauth>
                       </Header>
                     <Body>
                          <RetrieveRequestMsg xmlns="http://exacttarget.com/wsdl/partnerAPI">
                             <RetrieveRequest>
                                <ObjectType>${options.ObjectType}</ObjectType>`;

    if (options.ObjectType.toLowerCase().indexOf('dataextensionobject') !== -1){
        for (var p = 0; p < options.Properties.length; p++) {
            soap += "<Properties>" + options.Properties[p] + "</Properties>\n";
        }
    } else {
        let schema = getObjectSchema(options.ObjectType);

        for (var p = 0; p < schema.properties.length; p++) {
            soap += "<Properties>" + schema.properties[p].Name + "</Properties>\n";
        }
    }

    if(options.Filter){
        soap += `            <Filter xsi:type="SimpleFilterPart">
                                       <Property>${options.Filter.Property}</Property>
                                       <SimpleOperator>${options.Filter.SimpleOperator}</SimpleOperator>
                                       <Value>${options.Filter.Value}</Value>
                                    </Filter>`;
    }
    soap +=    `         </RetrieveRequest>
                          </RetrieveRequestMsg>
                     </Body>
                    </Envelope>`;

    //console.log(soap);

    var soapoptions = {
        "url":        endpoint,
        "method":     "POST",
        "headers":    {
            "Content-Type":'text/xml',
            "SoapAction":"Retrieve"
        },
        "body": soap
    };

    console.log('Soap',soap);

    // Return new promise
    return new Promise(function(resolve, reject) {
    	// Do async job
        request.post(soapoptions, function(err, response, body) {
            if (err) {
                console.log('RejectingSoap',err);
                reject(err);
            } else {
                try {
                    console.log('SoapResponse',body);
                    var myObject = parseSoap(body);

                    console.log("Response",JSON.stringify(myObject));

                    resolve(myObject);
                } catch (e) {
                    reject(e)
                }
            }
        })
    })
};

sfmc.prototype.upsert = function(options) {

    var endpoint = 'https://webservice.';
    if (options.stack.toLowerCase() !== 's1'){
        endpoint += options.stack + '.';
    }

    endpoint += 'exacttarget.com/Service.asmx';

    // Get Data Extension Fields
    var soap =     `<Envelope xmlns="http://schemas.xmlsoap.org/soap/envelope/" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">
                        <Header>
                            <fueloauth>${options.token}</fueloauth>
                        </Header>
                        <Body>
                            <UpdateRequest xmlns="http://exacttarget.com/wsdl/partnerAPI">
                                <Options>
                                  <SaveOptions>
                                     <SaveOption>
                                        <PropertyName>DataExtensionObject</PropertyName>
                                        <SaveAction>UpdateAdd</SaveAction>
                                     </SaveOption>
                                  </SaveOptions>
                                </Options>
                                <Objects xsi:type="DataExtensionObject">
                                    <CustomerKey>${options.customerkey}</CustomerKey>
                                    <Keys>`;

                                for (var k in options.keys) {
                                    soap += `<Key><Name>${k}</Name><Value>${options.keys[k]}</Value></Key>`;
                                }

                                soap += "</Keys><Properties>";

                                for (var p in options.properties) {
                                    soap += `<Property><Name>${p}</Name><Value>${options.properties[p]}</Value></Property>`;
                                }

                            soap += "</Properties></Objects></UpdateRequest></Body></Envelope>";

    //console.log(soap);

    var soapoptions = {
        "url":        endpoint,
        "method":     "POST",
        "headers":    {
            "Content-Type":'text/xml',
            "SoapAction":"Update"
        },
        "body": soap
    };

    return new Promise(function(resolve, reject) {
        request.post(soapoptions, function(err, response, body) {
            if (err) {
                reject(err);
            } else {
                try {
                    var myObject = parseSoap(body);
                    resolve(myObject);
                } catch (e) {
                    reject(e)
                }
            }
        })
    })
};

sfmc.prototype.createDataExtension = function(options) {
    //console.log(options);

    var endpoint = 'https://webservice.';
    if (options.Stack.toLowerCase() !== 's1'){
        endpoint += options.Stack + '.';
    }

    endpoint += 'exacttarget.com/Service.asmx';

    // Get Data Extension Fields
    var soap =  `<Envelope xmlns="http://schemas.xmlsoap.org/soap/envelope/" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance">
                    <Header>
                        <fueloauth>${options.Token}</fueloauth>
                    </Header>
                    <Body>
                        <CreateRequest xmlns="http://exacttarget.com/wsdl/partnerAPI">
                            <Options/>
                            <Objects xsi:type="ns2:DataExtension" xmlns:ns2="http://exacttarget.com/wsdl/partnerAPI">
                                <Name>${options.definition.Name}</Name>
                                <CustomerKey>${options.definition.CustomerKey}</CustomerKey>
                                <IsSendable>${options.definition.IsSendable}</IsSendable>
                                <IsTestable>${options.definition.IsTestable}</IsTestable>
                                <CategoryID>${options.definition.CategoryID}</CategoryID>`;

    if(options.definition.IsSendable == "true"){

        soap += `               <SendableDataExtensionField>
                                    <Name>${options.definition.SendableDataExtensionField.Name}</Name>
                                </SendableDataExtensionField>
                                <SendableSubscriberField>
                                    <Name>Subscriber Key</Name>
                                </SendableSubscriberField>
        `;
    }

    soap += `                   <Fields>`;

    let field;
    let systemProps = ["StorageType","ModifiedDate","CreatedDate","CustomerKey","ObjectID"];
    for (var f = 0; f < options.definition.fields.length; f++) {
        field = options.definition.fields[f];
        soap += '                   <Field>';

        for (var p in field) {
            if (typeof field[p] !== "object" && systemProps.indexOf(p) == -1) {
                soap += '               <' + p + '>' + field[p] + '</' + p + '>';
            }
        }

        soap += '                   </Field>';
    }

    soap +=    `                </Fields>
                            </Objects>
                        </CreateRequest>
                    </Body>
                </Envelope>`;


    //console.log(soap);


    return new Promise(function(resolve, reject) {
    	// Do async job
        var soapoptions = {
            "url":        endpoint,
            "method":     "POST",
            "headers":    {
                "Content-Type":'text/xml',
                "SoapAction":"Create"
            },
            "body": soap
        };
        request(soapoptions, function(err, response, body) {
            if (err) {
                reject(err);
            } else {
                let parsed;
                try {
                    parsed = clean(JSON.parse(convert.xml2json(response.body, {compact: true, spaces: 4})));

                    let newId = parsed["soap:Envelope"]["soap:Body"].CreateResponse.Results.NewObjectID;
                    resolve(newId);
                } catch (e){
                    reject(e);
                }
            }
        })
    })



    return soap;
};

sfmc.prototype.getEventDefinition = function(id,token) {

    var restoptions = {
        "url":        "https://www.exacttargetapis.com/interaction/v1/eventDefinitions/" + id,
        "method":     "GET",
        "headers":    {
            "authorization":'Bearer ' + token,
            "content-type":"application/json"
        }
    };

    // Return new promise
    return new Promise(function(resolve, reject) {
    	// Do async job
        request.get(restoptions, function(err, response, body) {
            if (err) {
                reject(err);
            } else {
                resolve(JSON.parse(body));
            }
        })
    })
};

