sfmc.prototype.restRequest = function(options) {
    var qs = '';
    if (options.parameters){
        qs = Object.keys(options.parameters).map(key => key + '=' + options.parameters[key]).join('&');
    }

    let url = "https://www.exacttargetapis.com" + options.path;

    if (qs.length > 0){
        url += "?" + qs;
    }

    let restoptions = {
        "url":        url,
        "method":     options.method,
        "headers":    {
            "authorization":'Bearer ' + options.token,
            "content-type":"application/json"
        }
    };

    if (options.body){
        restoptions.body = options.body;
    }

    //console.log("RestOptions",restoptions);

    // Return new promise
    return new Promise(function(resolve, reject) {
    	// Do async job
        request(restoptions, function(err, response, body) {
            if (err) {
                reject(err);
            } else {
                resolve(JSON.parse(body));
            }
        })
    })
};

function getObjectSchema (objectName){
    var schema = soapSchema();
    for (var i = 0; i < schema.objects.length; i++) {
        if (schema.objects[i].objectname == objectName){
            return schema.objects[i];
        }
    }

    return null;
}

function parseSoap(xml){
    try {
        var results;

        xml = xml.replace(/soap\:/g,'');
        xml = xml.replace(/wsa\:/g,'');
        xml = xml.replace(/wsse:\:/g,'');
        xml = xml.replace(/wsu:\:/g,'');
        var o = JSON.parse(convert.xml2json(xml, {compact: true, spaces: 4}));
        o = clean(o,'');

        if (o.Envelope.Body.RetrieveResponseMsg.Results){
            if(o.Envelope.Body.RetrieveResponseMsg.Results.constructor === Array){
                return o.Envelope.Body.RetrieveResponseMsg.Results;
            } else {
                return [o.Envelope.Body.RetrieveResponseMsg.Results];
            }
        } else {
            return null;
        }

    } catch (e){
        return null;
    }
}

function clean(obj,stack) {
    for (var property in obj) {
        if (obj.hasOwnProperty(property)) {
            if (typeof obj[property] == "object") {
                if (obj[property]["_text"]){
                    obj[property] = obj[property]["_text"];
                    delete obj[property]["_text"];
                }

                if (obj[property]["_attributes"]){
                    delete obj[property]["_attributes"];
                }

                if (obj[property]["_declaration"]){
                    delete obj[property]["_declaration"];
                }
                obj[property] = clean(obj[property], stack + '.' + property);
            }
        }
    }

    return obj;
}

